function TodoList(){
    const handleSubmit = (event) => {
        event.preventDefault();
    }
    return(
        <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="AddTask">AddTask:</label>
          <input
            type="text"
            id="addtask"
          />
        </div>
        <div>
          <label htmlFor="AddPriorityTask">PriorityTask</label>
          <input
            type="text"
            id="prioritytask"
          />
        </div>
        <button type="submit">AddTask</button>
      </form>
    )
}

export default TodoList;
